    else:
        print(0)

def Any(flag,m):
    judge=[flag[i] for i in m]
    if any(judge)==True:
        print(1)
    else:
        print(0)

def none(flag,m):
    judge=[flag[i] for i in m]
    if not any(judge)==True:
